import React from 'react';
import './machineries.css';
import PageHeader from '../../../Component/PageHeader/PageHeader';

export default function FlashMachineries() {
  const data = [
    { id: 1, title: "Card 1", description: "This is the first card.", image: "https://source.unsplash.com/300x200/?nature" },
    { id: 2, title: "Card 2", description: "This is the second card.", image: "https://source.unsplash.com/300x200/?technology" },
    { id: 3, title: "Card 3", description: "This is the third card.", image: "https://source.unsplash.com/300x200/?architecture" },
    { id: 4, title: "Card 4", description: "This is the fourth card.", image: "https://source.unsplash.com/300x200/?abstract" },
  ];

  return (

   <>
    <PageHeader/>
    <div className="cards-container">
      {data.map((item) => (
        <div key={item.id} className="card">
          <img src={item.image} alt={item.title} className="card-image" />
          <div className="card-content">
            <h3>{item.title}</h3>
            <p>{item.description}</p>
            <button className="card-button">Details</button>
          </div>
        </div>
      ))}
    </div>
   
   </>
  );
}







